import React from "react";
import { connect } from "react-redux";
import Creator from '../Creator/Creator'
import {TasksDiv} from './styled'
import Tasks from '../Tasks/Tasks'

class Planner extends React.Component {
  render() {
    return (
      <div>
        <div><Creator/></div>
        <TasksDiv>
          <Tasks dia={'Domingo'} />
          <Tasks dia={'Segunda'} />
          <Tasks dia={'Terça'} />
          <Tasks dia={'Quarta'} />
          <Tasks dia={'Quinta'} />
          <Tasks dia={'Sexta'} />
          <Tasks dia={'Sabado'} />
        </TasksDiv>
      </div>
    )
  }
}

export default connect()(Planner);
